import React, { Component } from "react";
import { FaRunning, FaCompactDisc } from "react-icons/fa";

import './index.css';

import '@trendmicro/react-sidenav/dist/react-sidenav.css';

import SideNav, {NavIcon, NavItem, NavText} from "@trendmicro/react-sidenav";

import Tabata from "./Tabata";
import Music from "./Music";

import {
    HashRouter,
    Route,
    NavLink
} from "react-router-dom";
import Image from "react-bootstrap/Image";
import Overlay from "react-bootstrap/Overlay";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";


class Main extends Component {
    render() {
        return (
                <HashRouter>
                    <div>
                        <div className="header">
                            <Navbar bg="dark" variant="dark">
                                    <Navbar.Brand href="#home">Navbar</Navbar.Brand>
                                    <Nav className="mr-auto">
                                        <Nav.Link href="#Tabata">Tabata</Nav.Link>
                                        <Nav.Link href="#Music">Musica</Nav.Link>
                                    </Nav>
                            </Navbar>
                        </div>
                    <div className="content" >
                        <Container href={"target"}>
                            <Route path="/services" component={Tabata}/>
                            <Route path="/contact" component={Music}/>
                        </Container>
                    </div>
                </div>
                </HashRouter>

        );
    }
}

export default Main;
